import React from "react";
import axios from "axios";

const LikeBlog = (props) => {
  const { blogId } = props;
  const handleLike = () => {
    axios
      .post(`/api/posts/${blogId}/like`)
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  return (
    <div>
      <button className="btn btn-success" onClick={handleLike}>
        Like
      </button>
    </div>
  );
};

export default LikeBlog;
